import './Forms.css';

function Post() {
    return <div>
        <form>
            <input type="text" placeholder="Username" /><br />
            <input type="password" placeholder="Password" /><br />
            <input type="file" /><br />
            <button onClick={submitpost}>Post</button>
        </form>
    </div>
}

export default Post;
